INSERT INTO `news` (`id`, `title`, `slug`, `image`, `description`, `created_at`, `updated_at`) VALUES
(4, 'Challenges and future opportunity of  E-commerce in Nepal', 'challenges-and-future-opportunity-of-e-commerce-in-nepal', 'news-emall-20180520150904-HRZs5-IOT-600x395.jpg', '<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Challenges and future opportunity of <span style=\"mso-spacerun: yes;\">&nbsp;</span>E-commerce in Nepal </span></strong></p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\"><u><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">E-commerce in Nepal</span></u></strong></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">E-commerce has been an easy industry to enter since decade, but till now the challenges are still same.<span style=\"mso-spacerun: yes;\">&nbsp; </span>In e-commerce industry due to low investment <span style=\"mso-spacerun: yes;\">&nbsp;</span>and easy access the trend of the industry is highly taking pace. The actual population of Nepal is 3 crore whereas it has small market and also the users are also not much because of not knowing its benefits, its importance and also its knowledge. </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Most of the e-commerce companies in Nepal has not been able to generate the revenue because of the challenges they face and that lead them to sustain in this competitive market. Due to various <span style=\"mso-spacerun: yes;\">&nbsp;</span>problem like lack of knowledge <span style=\"mso-spacerun: yes;\">&nbsp;</span>how e-commerce industry actually work, and also due to lack of knowledge about the payment gateway system, and also the awareness regarding the e-commerce industry. </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Not only that the e-commerce industry also has to play a part to make aware to the consumers about the e-commerce and its trend in Nepal.<span style=\"mso-spacerun: yes;\">&nbsp; </span>They also have to think how they can build the trust of the customers and make them easy of their livelihood.</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\"><u><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Major issue</span></u></strong><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> :-</span></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&Oslash; </span></span><!--[endif]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Lots of competitions and less markets.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&Oslash; </span></span><!--[endif]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Lack of knowledge of e-commerce industry.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&Oslash; </span></span><!--[endif]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Lack of professionalism</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&Oslash; </span></span><!--[endif]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Lack of innovation and copying nature.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&Oslash; </span></span><!--[endif]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Logistic problem and its proper management.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&Oslash; </span></span><!--[endif]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Low internet reach, lack of proper digital payment.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&Oslash; </span></span><!--[endif]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Trust issues and not focusing customers for long term.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&Oslash; </span></span><!--[endif]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Not understanding consumer behavior and their trend of pattern.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&Oslash; </span></span><!--[endif]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Not having varieties of products and cost issues.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&Oslash; </span></span><!--[endif]--><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Not proper policy in Nepal.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">As e-commerce industry have been facing various major issues in their business and now by the latest news flash out that E-commerce giant Alibaba will enter in the Nepalese market. E-commerce giants are entering in Nepal and the trend may increase rapidly in near future. It has been threat to these e-commerce companies who have been operating since year and people have started to predict that low capital e-commerce company will definitely collapse and if they don&rsquo;t make themselves upgrade and understand the gap between the consumers and their pattern of business then they will definitely be in dark side of the business. <span style=\"mso-spacerun: yes;\">&nbsp;</span></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><strong style=\"mso-bidi-font-weight: normal;\"><u><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Future of e-commerce in Nepal </span></u></strong></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Experts or concerned authority should also make strong policy regarding the e-commerce in Nepal. They also must develop the well function online gateway system in Nepal. Government also focus on developing and tracking the e-commerce business and the way they are operating and also support them through various of policy, guidance , payment system, and help in understanding and being selective while opening the company in this industry to make aware of the market and control the market of the e-commerce industry.</span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\r\n<p class=\"MsoListParagraphCxSpLast\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Trends of e-commerce industry are increasing , many e-commerce companies are also doing well because of their understanding of the industry. There are many things to do in this industry and people are also now being aware about it. They are now slowly believing and trusting this e-commerce industry. So, if the major issues are solved, target the market with proper understanding of consumers what they want and what they expect, <span style=\"mso-spacerun: yes;\">&nbsp;</span>new innovative and easy access system and also understand the model and have concrete plans, have consistency and also achieve milestones accordingly <span style=\"mso-spacerun: yes;\">&nbsp;</span>then definitely this industry will definitely have bright future. </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>', '2018-05-20 19:09:04', '2018-05-20 19:09:04');
