(994, 12, 75, NULL, 2, 'Philips 55PFA4300/98 55\" Full HD 1080p LED TV- Black', 'philips-55pfa430098-55-full-hd-1080p-led-tv-black-20181101134521', NULL, 10, 0, 0, 1, 106900.00, 'Display screen\r\nAs clear from the name, the screen size is a whooping 55 inches and thus is a great choice for watching movies or live games and events. It comes with full HD features that offer unmatched clarity. The screen resolution is 1920 x 1080 pixels ensuring your crisp and clear images. \r\nAudio\r\nNo TV is great without its sound quality and this TV offers you a superb sound quality thanks to its 2 built-in speakers and 16 Watts audio output. It features a stereo sound system for the ultimate sound experience!\r\nTechnology\r\nYou can be assured of one thing with this TV and that is great picture quality. It features both LED and HD technology ensuring the best viewing experience. It also comes with energy saving technology.\r\nModes and Settings\r\nAs far as modes and settings of sound and picture are concerned, you can expect the standard pre-installed settings that come with all LED TVs. \r\nConnectivity \r\nYou can easily connect this TV to external devices with its HDMI and USM ports. \r\nOther Features\r\nThis huge LED TV has a very sleek design and a perfect motion rate of 100 Hz. It has an easy graphical user interface.\r\nEnergy Ratings\r\nDespite its huge screen size, its power requirement is only 50-60 Hz, AC 100-240V Hz, which does not haul up too much of your electric bills.', NULL, NULL, NULL, 0, 0, 0, '2018-11-01 08:00:21', '2018-11-01 08:00:21'),
