(1001, 21, 66, 50, 2, 'Beko Double Door Refrigerator', 'beko-double-door-refrigerator-20181101160203', NULL, 10, 0, 0, 1, 44675.00, 'General Features:\r\n\r\n- Freezer guard lets you position the appliance anywhere in your home\r\n- Clever storage for all of your chilled and frozen goods\r\n- Safety features including an open door alarm\r\n- Reversible doors to fit into any available space\r\n\r\nOur experts love that by circulating cool air around the freezer cavity, these frost free Beko fridge freezers prevent the build up of ice to ensure you\'ll never have to defrost again. Maximise your potential freezer space whilst keeping energy consumption to an absolute minimum.\r\n\r\nFreezer guard\r\n\r\nThanks to Beko\'s freezer guard technology, you can position your freezer anywhere in the home – even if the outside temperature reaches -15°C. Your food will stay frozen without causing damage to the fridge freezer.\r\n\r\nThe freezer is also frost free, so you don\'t have to worry about defrosting manually.', NULL, NULL, NULL, 0, 0, 0, '2018-11-01 10:17:03', '2018-11-01 10:17:03');
