(1274, 36, NULL, NULL, 2, 'One Side Baby Carry Bags', 'one-side-baby-carry-bags-20190529075330', NULL, 10, 0, 250, 1, 1300.00, 'Suitable for babies from approx. 3 to 36 months.\r\nAccording to ergonomic principles, extra-wide shoulder strap and extra-wide belt could balance the burden efficiently.\r\nThe environmental material of breathable mesh fabric, with a good breathable performance.\r\nCarry your baby in a safe, secure cradle, while keeping your hands free.\r\nHigh quality, safe and comfortable.\r\nComfortable padded shoulder straps.\r\nSix easy-to-use carrier positions.\r\nAdjustable snaps, straps and buckles are easy to change as your baby grows unique head support design, use up or fold down swivel hooks rotate 360 degrees making attachment easy soft padded material.\r\nMachine washable.', NULL, NULL, NULL, 0, 0, 0, '2019-05-29 02:08:30', '2019-05-29 02:08:30'),
(1275, 36, NULL, NULL, 2, 'Baby Travel Bed and Bags', 'baby-travel-bed-and-bags-20190529075633', NULL, 5, 0, 1001, 1, 4000.00, 'Baby travel bag and bed, easy and comfortable, fold-able.\r\n\r\n- Replaces All of The Other Bags, All In One!\r\n- 9 in 1 Multi-functional Design.\r\n- Diaper Bag, Travel Bed, Carry Cot.\r\n- Waterproof bedding, Changing Pad, Insulated pocket.\r\n- Entertainment Bar, Mosquito Netting, Stroller Hanging Straps.', NULL, NULL, NULL, 0, 0, 0, '2019-05-29 02:11:33', '2019-05-29 02:11:33'),
(1276, 36, NULL, NULL, 2, 'Smart Carousel Organizer', 'smart-carousel-organizer-20190529075842', NULL, 8, 0, 301, 1, 1100.00, 'The ultimate way to maximize your space.\r\n\r\nWith 3 shelves and 24 pockets this unique Smart Closet Organizer stores your shoes, boots, belts, hats, purses, sweaters, linens, arts, crafts, and toys.\r\n\r\nThe 360 degree swivel hanger gives you access to every pocket and shelf in one simple swirl.\r\n\r\nLifts all your items up off the floor and organizes them so when you are ready to use they are right there, visible and clean.\r\n\r\nThe durable VentilAir material allows items to breathe keeping them fresh.', NULL, NULL, NULL, 0, 0, 0, '2019-05-29 02:13:42', '2019-07-26 16:09:11'),
(1277, 21, 65, NULL, 2, 'Hand Fruit Juicer', 'hand-fruit-juicer-20190529152716', NULL, 8, 0, 0, 1, 1050.00, 'Brand	Able\r\nMaterial	Plastic\r\nUsage	Domestic\r\nSpecifically Designed To Extract Maximum Juice From Hard As Well As Juicy Fruits & Vegetable', NULL, NULL, NULL, 0, 0, 0, '2019-05-29 09:42:16', '2019-07-26 16:09:11'),
(1278, 21, 65, NULL, 2, 'Cleaver Cutter', 'cleaver-cutter-20190530151211', NULL, 1, 0, 150, 1, 850.00, 'Clever Cutter is the revolutionary 2-in-1 knife and cutting board that chops and slices your favorite foods in seconds.\r\n\r\nThe secret of the 2-in-1 design is the ergonomic power pressure handle which helps you to effortlessly cut through food fast.\r\n\r\nClever Cutter’s premium blade and extra wide mouth makes cutting fruits, veggies, meats and more fast, easy, and mess-free.', NULL, NULL, NULL, 0, 0, 0, '2019-05-30 09:27:11', '2019-09-18 06:30:28');
